import React, { useState, useEffect } from "react";
import { ChartComponent } from "./ChartComponent/ChartComponent";

const test = {
  1: [{ name: "series-2", data: [20, 30, 55, 20, 39, 10, 50] }],
  2: [{ name: "series-3", data: [10, 20, 35, 10, 29, 20, 40] }],
  3: [{ name: "series-4", data: [40, 50, 65, 40, 59, 50, 60] }],
};

const initialChartSetings = {
  chartData: {
    type: "bar",
    options: {},
    series: [
      {
        name: "series-1",
        data: [10, 20, 35, 10, 29, 20, 40],
      },
      {
        name: "series-2",
        data: [20, 30, 55, 20, 39, 10, 50],
      },
    ],
  },
};

export const ChartConstructor = ({ setings }) => {
  const [chartSetings, setChartSetings] = useState(initialChartSetings);

  return (
    <div>
      <ChartComponent chartData={chartSetings.chartData} />
    </div>
  );
};
